  var array = new Array(rows);
  for (var i = 0; i < rows; i++) {
    array[i] = new Array(columns);

  function multiply_scalar(a, b) {

PI2CA(clickCounter)

function PI2CA(clickCounter){    
    
// Original Trace to select (heatmap)


var url = 'https://raw.githack.com/Vlasenko2006/PI2CA/main/empty.jpg'

function myFunction() {
  document.getElementById("background").style.backgroundImage = url;
};

var date = prompt("Please enter desirable date:", 1);

var c = 0;
for (i = 0; i<5; ++i){
c = Math.tanh(W0[0]*Indexes[date][0]+W0[1]*c+W0[2]);
}
var M0 = scale[0]*c; 

var c = 0;
for (i = 0; i<5; ++i){
c = Math.tanh(W1[0]*Indexes[date][1]+W1[1]*c+W1[2]);
}
var M1 = scale[1]*c; 

var c = 0;
for (i = 0; i<5; ++i){
c = Math.tanh(W2[0]*Indexes[date][2]+W2[1]*c+W2[2]);
}
var M2 = scale[2]*c; 


var c = 0;
for (i = 0; i<5; ++i){
c = Math.tanh(W3[0]*Indexes[date][3]+W3[1]*c+W3[2] );
}
var M3 = scale[3]*c; 



if (clickCounter == 0){
var too1 = multiply_scalar(M0_NO2,M0);
var too2 = multiply_scalar(M1_NO2,M1);
var too3 = multiply_scalar(M2_NO2,M2);
var too4 = multiply_scalar(M3_NO2,M3);

var too = sum_ab(t1,t2);




}
else{

var too1 = multiply_scalar(M0_NO2,M0);
var too2 = multiply_scalar(M1_NO2,M1);
var too3 = multiply_scalar(M2_NO2,M2);
var too4 = multiply_scalar(M3_NO2,M3);
var t1 = sum_ab(too2,too1);
var t2 = sum_ab(too3,too4);
var too = sum_ab(t1,t2);



var too = sum_ab(too2,too1);

};



too[0][0] = 0
too[0][1] = 0



var maxRow = too.map(function(row){ return Math.max.apply(Math, row); });
var M = Math.max.apply(null, maxRow);
var minRow = too.map(function(row){ return Math.min.apply(Math, row); });
var m0 = Math.min.apply(null, minRow);

var m =  Math.min(m0,-M) 


too[0][0] = M
too[1][0] = m


var orgTrace = {
    z: too,
    colorscale: 'Picnic',
    type: 'heatmap',
    opacity: 0.99,
    colorbar: {title:'ppmV',

    borderWidth: 5  
     
  };
// empty trace, will be filled with selected data
var selectedTrace = {x: [],

var data = [orgTrace, selectedTrace];

// OPTIONAL: define a final height value and
